import PopupWithForm from "./PopupWithForm";

export default function DeleteCardPopup({ isOpen, onClose }) {
  return (
    <PopupWithForm
      title="Вы уверены?"
      name="delete"
      buttonText='Да'
      isOpen={isOpen}
      onClose={onClose}
    />
  );
}
